/*global jQuery */
(function (cwApi, $) {

    "use strict";
    // constructor
    var node = function (id,object_id,label,customDisplayString,icon,status,filterArray,nodeOptions,networkInfo) {
        this.id = id;
        this.object_id = object_id;
        this.label = label;
        this.shortlabel = label.slice(0,50);
        this.status = status;
        this.customDisplayString = customDisplayString;
        this.filterArray = filterArray;
        this.icon = icon;
        this.options = nodeOptions;
        if(networkInfo) {
            this.x = networkInfo.x;
            this.y = networkInfo.y;
            this.status = networkInfo.enable;            
        }
    };

    node.prototype.getLabel = function () {
        if(this.options.CDSFilterOption) return this.customDisplayString;
        else return this.label;
    };

    node.prototype.getStatus = function () {
        return this.status;
    };

    node.prototype.setStatus = function (status) {
        if(this.status === status) {
            return false;
        }
        this.status = status;
        return true;
    };

    node.prototype.getId = function () {
        return this.id;
    };

      //permet de lire les propriétés de l'asso et de choisir quoi afficher en fonction du champs custom
    node.prototype.getVisData = function () {
        var obj = {};
        obj.id = this.id;
        obj.object_id = this.object_id;
        if(this.options.CDSNodesOption) {
            obj.label = this.shortlabel;
            obj.name = this.label;
        }
        else {
            obj.label = this.label;
        }

        if(this.x) {
            obj.x = this.x;
            this.x = undefined;
        }
        if(this.y) {
            obj.y = this.y;
            this.y = undefined;
        }
        if(this.icon) {
            obj.shape = 'icon';
            obj.icon = {};
            obj.icon.face = 'FontAwesome';
            obj.icon.code = unescape('%u' + this.icon.code);
            obj.icon.size = 40;
            obj.icon.color = this.icon.color;           
        }


        return obj;
        //'shape': 'image', 'image': 'data:image/png;base64,'};
        //
    };


    node.prototype.updatePostionAndState = function (update) {
        if(update.x) this.x = update.x;
        if(update.y) this.y = update.y;
        this.status = update.status;
    };


    //permet de lire les propriétés de l'asso et de choisir quoi afficher en fonction du champs custom
    node.prototype.getDataForExport = function () {
        var obj = {};
        obj.id = this.id;
        if(this.x) obj.x = this.x;
        if(this.y) obj.y = this.y;
        obj.status = this.status;
        obj.name = this.label;

        return obj;
        //'shape': 'image', 'image': 'data:image/png;base64,'};
        //
    };





  node.prototype.getEnabledVisData = function () {
        var node;
        if(this.status === true) {
           return this.getVisData();
        } 
    };


    node.prototype.getVisDataIfDeactivated = function (option) {
        var node;
        // si highlight on renvoie que si status == true
        if(option === true && this.status === true) return this.getVisData();
        if(option === true && this.status === false) return null;
        if(this.status === false) {
            this.status = true;
           return this.getVisData();
        }

        node = this.getVisData();
        node.alreadyInNetwork = true;
        return node;
    };

    if (!cwApi.customLibs) {
        cwApi.customLibs = {};
    }
    if (!cwApi.customLibs.cwLayoutNetwork) {
        cwApi.customLibs.cwLayoutNetwork = {};
    };
    if (!cwApi.customLibs.cwLayoutNetwork.node) {
        cwApi.customLibs.cwLayoutNetwork.node = node;
    }

}(cwAPI, jQuery));